import 'bootstrap/dist/css/bootstrap.css';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

class Chart extends Component {

    constructor(props){
        super(props);

        // initiiere einen leeren state
        this.state = {
          data: [
            {
              name: "Task 1",
              Default_Zeit: 1000,
              pv: this.props.task1Duration,
              amt: 2400,
            },
            {
              name: "Task 2",
              uv: 1500,
              pv: this.props.task2Duration,
              amt: 2210,
            },
            {
              name: "Task 3",
              uv: 8000,
              pv: this.props.task3Duration,
              amt: 2290,
            }
          ],

